import React from "react";
import { Bar } from "react-chartjs-2";

const PieChart = () => {
  return (
    <div>
      <Bar
        height={200}
        width={300}
        data={{
          labels: ["Shoes", "Clothes", "Electronics"],
          dataset:[
            {
              label: ' Categories',
              data: [25, 14 , 19]
            }
          ]
        }}
        options={{
          maintainAspectRation: false
        }}
      />
    </div>
  );
};

export default PieChart;
